import React, { useState } from 'react';

import '../styles/Appointment.css'

const Appointment = () => {
    const [gender, setGender] = useState('');
    const [dateTime, setDateTime] = useState('');

    const handleGenderChange = (event) => {
        setGender(event.target.value);
    };

    const handleDateTimeChange = (event) => {
        setDateTime(event.target.value);
      };
  
  return (
    <div className="form">
        <form>
         <h1>Appointment <span>Form</span></h1>
         <input type="text" className="name" id="" placeholder='Enter Full Name' />
         <input type="address" className="address" id="" placeholder='Enter Address' />
        <select id="gender" name="gender" value={gender} onChange={handleGenderChange}>
          <option value="">Select Gender</option>
          <option value="male">Male</option>
          <option value="female">Female</option>
        </select>
        <input type="datetime-local" id="datetime" name="datetime" value={dateTime} onChange={handleDateTimeChange}/>
         <input type="email" className="email" id="" placeholder='Sample@gmail.com' />
         <input type="phone" className="phone" id="" placeholder='Enter Phone' />
         <textarea name="message" id="" cols="30" rows="5" placeholder='Message....'/>
         <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default Appointment;
